import React from'react';
import { BrowserRouter,Route,Routes,Link } from'react-router-dom';
import Login from './Login';
import Signup from './Signup';
import Home from './Home';
function Header () {
    return (
        <div>
        <div className="flex justify-between bg-primary p-4">
            <h1 className="text-3xl font-bold ">Elixer</h1>
            <BrowserRouter>
            <ul className="pt-3 flex">
                <li className="text-white px-3"><Link to='/'>Home</Link></li>
                <li className="text-white px-3"><Link to='/about'>About</Link></li>
                <li className="text-white px-3"><Link to='/contact'>Contact</Link></li>
                <li className="text-white px-3"><Link to='/login'>Login</Link></li>
                <li className="text-white px-3"><Link to='/signup'>Signup</Link></li>
            </ul>
            <Routes>
                <Route path="/" element={<Home/>} />
                <Route path="/login" element={<Login/>} />
                <Route path="/" element={<Home/>} />
                <Route path="/signup" element={<Signup/>} />
                <Route path="/" element={<Home/>} />
            </Routes>
            </BrowserRouter>
            
        </div>
        <div>
        {/* <BrowserRouter>
            
            
            </BrowserRouter> */}
        </div>
        </div>
    )
}

export default Header;
